import React from 'react';
import NowPlaying from './pages/NowPlaying/NowPlaying.js'
import './App.css';

function App() {
  return (
    <div className="App">

      <header className="App-header">
      <div id="circle">
        <h1 id="main-heading">The <br></br>Ultimate <br></br>Moviegoers <br></br>Guide</h1>
        </div> 
      </header>

  <NowPlaying/>

    </div>
  );
}

export default App;
